    setIsModalOpen(true);
  };
  const handleOk = () => {
    setIsModalOpen(false);
  };
  const handleCancel = () => {
    setIsModalOpen(false);
  };
  return (
    <>
      <Modal title="PERSONEL GÖRÜNTÜLEME" open={isModalOpen} onOk={handleOk} onCancel={handleCancel}  >

      </Modal>
    </>
  );
}

